  proto_deps:
  - name: google-common-protos
  src_proto_paths:
  - google/android/overtheair/v1
  service_yaml: google/android/overtheair/overtheair.yaml
  gapic_yaml: google/android/overtheair/v1/androidovertheair_gapic.yaml
artifacts:
- name: gapic_config
  type: GAPIC_CONFIG
- name: java_gapic
  type: GAPIC
